pragma solidity ^0.4.18;//please import oraclizeAPI_pre0.4.sol when solidity < 0.4.0

import "./oraclizeAPI_0.5.sol";
contract RoleSC is usingOraclize {

  string public result;
  bytes32 public oraclizeID;
function RoleSC() public {
oraclize_setProof(proofType_TLSNotary | proofStorage_IPFS);
}
 function test() public{
 oraclizeID=oraclize_query("URL","https://popular-lion-30.localtunnel.me/api/v1/test");
  }

  function adoptRole  (string role,string GrArtId) {
  string memory str=strConcat("&","idd=");
    oraclizeID = oraclize_query("URL",strConcat("https://popular-lion-30.localtunnel.me/api/v1/adopt?role=",role,str,GrArtId));
  }
function createGroup (string id,string t,string artid) {
string  memory str1=strConcat("&","type=",t);
string memory str2=strConcat("&","idd=",artid);
    oraclizeID = oraclize_query("URL",strConcat("https://popular-lion-30.localtunnel.me/api/v1/create?id=",id,str1,str2));
  }

  function __callback(bytes32 _oraclizeID, string _result) {
    if(msg.sender != oraclize_cbAddress()) throw;
    result = _result;
  }

}
